import React from 'react';
import FakeBookings from './data/fakeBookings.json'
;

function DateDiffs() {
  function DiffInDates(strDate, endDate){

    const dateInMs = new Date(endDate) - new Date(strDate);
    const diffInDays = dateInMs / (1000 * 60 * 60 * 24)
    return diffInDays;
  }
  return(
    <div>
      <DiffInDates name="{FakeBookings}" />
    </div>
  )
}
export default DateDiffs
